import React from 'react';
import Navbar from './Navbar';
import Card from './Card';


const Service = () => {
    return (
        <>
            <Navbar />

            <div className='container'>
                <Card 
                    title='Web Develop'
                />


            </div>
        </>
    )
}
export default Service;
